import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';  // מייבא את useNavigate במקום useHistory
import { logoutUser } from '../api';

function Logout() {
  const navigate = useNavigate();  // משנה ל-useNavigate

  useEffect(() => {
    // נבצע את ההתנתקות כאשר המשתמש מבקר בעמוד הזה
    logoutUser();
    navigate('/login');  // הפניית המשתמש לעמוד ההתחברות
  }, [navigate]);  // תוודא שהשימוש ב-navigate נכון ויעבוד

  return <div>Logging out...</div>;
}

export default Logout;
